import React from "react";
import { useParams } from "react-router";
import { useWishCartContext } from "../../context/WishCartContext";

export const ProductDetail = () => {
  const { id } = useParams();
  console.log(id);
  const {
    state: { products },
  } = useWishCartContext();
  const product = products.find((item) => item.id === Number(id));
  console.log(product);
  return (
    <>
      <div className="container">
        <div className="grid">
          /**
          {product?.map(
            ({
              id,
              name,
              price,
              images: { img_1, img_2 },
              inStock,
              intro,
              summary,
              description,
              category,
              additionalInfo,
              fastDelivery,
            }) => (
              <>
                <h1>{name}</h1>
              </>
            )
          )}{" "}
          **/
        </div>
      </div>
    </>
  );
};
